      SELECT DISTINCT 78 * - tab2.col0 AS col0 FROM tab1 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet), tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q7829.out
    data: |
      -546
      -6084
      -6162
